    "northeastern-montana-wetlands-management-district-annual-narrative-report-calendar-year-19-a05d0",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Northeastern
    Montana Wetlands District outlines WMD accomplishments during the 1982 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. Refuge administration is outlined; information about
    funding is given. Habitat management is also covered; subjects include wetlands,
    croplands, grasslands, pest control, and WPA easements. The wildlife section of
    the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, and fisheries resources.
    The public uses of the Refuge described in this report include hunting and trapping.",nt"license_title":
